import { Logo } from "../Logo";
import { Box } from "@chakra-ui/react";
import { Register } from "./Register";
import { Login } from "./Login";

export const Header = () => {
  return (
    <Box
      display={"flex"}
      flexDirection={"row"}
      justifyContent={"space-between"}
    >
      <Logo />
        <Box   m={"69px 132px 0 0"}>
          <Login />
          <Register />
        </Box>
    </Box>
  );
};
